// import {Link} from 'react-router-dom'
function ContulMeu() {
  return (
    <>
      <h1>Contul meu</h1>
      <form className="contulMeu">
        <div>
          <label htmlFor="nume">Nume</label>
          <input type="text"/>
        </div>
        <div>
          <label htmlFor="nume">Nume</label>
          <input type="text"/>
        </div>
        <div>
          <label htmlFor="nume">Nume</label>
          <input type="text"/>
        </div>
      </form>
    </>
  );
}
export default ContulMeu;
